import React from "react";
import { FaGithub, FaLinkedin, FaEnvelope } from "react-icons/fa";
import { motion } from "framer-motion";
import Timeline from './components/Timeline';
import Certifications from './components/Certifications';
import TechStack from './components/TechStack';




export default function App() {
  return (
    <div className="bg-white/10 backdrop-blur-md border border-white/20 p-6 rounded-3xl shadow-xl hover:shadow-2xl transition duration-300">
      <Navbar />
      <Hero />
      <Timeline />
      <Certifications />
      <TechStack />
      <Projects />
      <Skills />
      <Contact />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <motion.nav
      initial={{ opacity: 0, y: -20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8 }}
      className="fixed top-0 w-full bg-gray-900 bg-opacity-70 backdrop-blur-md p-4 z-10"
    >
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-2xl font-bold text-blue-400">Yassine</div>
        <div className="flex space-x-6 text-xl text-gray-300">
          <a href="https://github.com/yassine1mac" target="_blank" rel="noopener noreferrer" className="hover:text-white transition">
            <FaGithub />
          </a>
          <a href="https://www.linkedin.com/in/yassine-chmirrou-a4a361200/" target="_blank" rel="noopener noreferrer" className="hover:text-white transition">
            <FaLinkedin />
          </a>
          <a href="mailto:yassinechmirrou1@gmail.com" className="hover:text-white transition">
            <FaEnvelope />
          </a>
        </div>
      </div>
    </motion.nav>
  );
}

function Hero() {
  return (
    <section className="h-screen flex flex-col justify-center items-center text-center px-6" id="home">
      <motion.h1
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 1 }}
        className="text-5xl md:text-7xl font-extrabold text-white"
      >
        Hi, I'm Yassine
      </motion.h1>
      <motion.p
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 1, delay: 0.3 }}
        className="mt-4 text-xl md:text-2xl text-gray-300 max-w-2xl"
      >
        AI & Big Data Engineer passionate about building intelligent, data-driven solutions for real-world problems.
      </motion.p>
    </section>
  );
}

const projectList = [
  {
    title: "Food & Calorie Estimation App",
    tech: "ResNet18, PyTorch, Streamlit, Docker",
    desc: "Deep learning model to classify food and estimate calories. Deployed with Streamlit and containerized with Docker.",
  },
  {
    title: "Cheating Detection System",
    tech: "OpenCV, Pose Estimation, XGBoost, MLflow",
    desc: "Behavior classifier using body keypoints to detect cheating. Experiments tracked with MLflow.",
  },
  {
    title: "Hotel Review Sentiment Analysis",
    tech: "Selenium, BERT, LDA, Excel",
    desc: "Scraped and analyzed hotel reviews from Booking & TripAdvisor, applying topic modeling and sentiment analysis.",
  },
];


function Projects() {
  return (
    <section className="container mx-auto py-20 px-6 md:px-20" id="projects">
      <motion.h2
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
        className="text-4xl font-bold text-blue-300 mb-12"
      >
        Projects
      </motion.h2>
      <div className="grid gap-8 md:grid-cols-3">
        {projectList.map((proj, idx) => (
          <motion.div
            key={idx}
            whileHover={{ scale: 1.05 }}
            className="bg-gray-800 p-6 rounded-3xl shadow-xl transform transition-transform"
          >
            <h3 className="text-2xl font-semibold text-white">{proj.title}</h3>
            <p className="text-sm text-blue-300 mt-2">{proj.tech}</p>
            <p className="mt-4 text-gray-300 text-sm">{proj.desc}</p>
          </motion.div>
        ))}
      </div>
    </section>
  );
}

const skills = [
  "Python",
  "SQL",
  "TensorFlow",
  "PyTorch",
  "Scikit-learn",
  "Streamlit",
  "Flask",
  "React",
  "Docker",
  "Git",
];

function Skills() {
  return (
    <section className="container mx-auto py-20 px-6 md:px-20 bg-gray-900" id="skills">
      <motion.h2
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
        className="text-4xl font-bold text-blue-300 mb-12"
      >
        Skills
      </motion.h2>
      <div className="flex flex-wrap gap-4">
        {skills.map((skill, idx) => (
          <motion.span
            key={idx}
            whileHover={{ scale: 1.1 }}
            className="px-4 py-2 bg-gradient-to-r from-blue-600 to-purple-600 rounded-full text-xs font-semibold"
          >
            {skill}
          </motion.span>
        ))}
      </div>
    </section>
  );
}

function Contact() {
  return (
    <section className="container mx-auto py-20 px-6 md:px-20 text-center" id="contact">
      <motion.h2
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
        className="text-4xl font-bold text-blue-300 mb-6"
      >
        Contact Me
      </motion.h2>
      <p className="text-gray-400 mb-6">Feel free to reach out for collaborations or internships!</p>
      <a
        href="mailto:yassinechmirrou1@gmail.com"
        className="inline-block bg-blue-600 hover:bg-blue-500 text-white px-6 py-3 rounded-full font-medium transition"
      >
        Email Me
      </a>
    </section>
  );
}

function Footer() {
  return (
    <footer className="text-center text-gray-500 py-6 text-sm">
      © 2025 Yassine Chmirrou • Built with React & Tailwind CSS
    </footer>
  );
}
